import { Container, Row, Col } from "react-bootstrap";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import meter1 from "../assets/img/meter1.svg";
import meter2 from "../assets/img/meter2.svg";
import sixtycent from "../assets/img/six.svg";
import seventycent from "../assets/img/sevencent.svg";
import eighty from "../assets/img/eight.svg";
import colorSharp from "../assets/img/color-sharp.png";
// import { render } from "@testing-library/react";


export const Skills = () => {
    const responsive = {
        superLargeDesktop: {
          // the naming can be any, depends on you.
            breakpoint: { max: 4000, min: 3000 },
            items: 5
        },
        desktop: {
            breakpoint: { max: 3000, min: 1024 },
            items: 3
        },
        tablet: {
            breakpoint: { max: 1024, min: 464 },
            items: 2
        },
        mobile: {
            breakpoint: { max: 464, min: 0 },
            items: 1
        }
    };  

    let itemList = [];
    const map1 = new Map();

    map1.set('Java', meter2);
    map1.set('JavaScript', meter2);
    map1.set('MySql', meter1);
    map1.set('Angular', seventycent);
    map1.set('React', sixtycent);
    map1.set('Css', meter1);
    map1.set('HTML5', meter1);
    map1.set('Scss', eighty);

    let cont = 0;
    for (let [key, value] of map1) {
        cont++;
        itemList.push(
            <div className="item" key={cont}>
                <img src={value} alt="Image"/>
                <h5>{key}</h5>
            </div>
        )
    }

    return (
        <section className="skill" id="skills">
            <Container>
                <Row>
                    <Col className="col-12">
                        <div className="skill-bx wow zoomIn">
                            <h2>Skills</h2>
                            <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry.
                                <br></br> Lorem Ipsum has been the industry's standard dummy text.
                            </p>
                            <Carousel responsive={responsive} infinite={true} className="skill-slider owl-carousel owl-theme">
                                {
                                    itemList
                                }
                            </Carousel>
                        </div>
                    </Col>
                </Row>
            </Container>
            <img className="background-image-left" src={colorSharp} alt="Image"/>
        </section>
    )
}


window.onload = inicio;

function inicio () {
    adjustArrow();
}
function adjustArrow() {


    let arrow_left = document.getElementsByClassName('react-multiple-carousel__arrow--left');

    console.log(arrow_left[0]);
    // arrow_left.style.left = 'calc(4% + 1px)';
}
